def is_funny_string(s: str) -> str:
    """"""
    if len(s) < 2:
        return 'Not Funny'
    reverse_s = s[::-1]
    for i in range(1, len(s)):
        if abs(ord(s[i]) - ord(s[i - 1])) != abs(ord(reverse_s[i]) - ord(reverse_s[i - 1])):
            return 'Not Funny'
    return 'Funny'
